import React from 'react';
import TrainerList from './components/TrainerList';

function App() {
  const trainers = [
    { id: 1, name: 'John Doe', specialization: 'Strength Training', experience: 5, contact: 'john@example.com' },
    { id: 2, name: 'Jane Smith', specialization: 'Yoga', experience: 3, contact: 'jane@example.com' },
    { id: 3, name: 'Mike Lee', specialization: 'Cardio', experience: 7, contact: 'mike@example.com' },
  ];

  return (
    <div className="App">
      <h1>Our Trainers</h1>
      <TrainerList trainers={trainers} />
    </div>
  );
}

export default App;
